import React from "react";

import Button from "@material-ui/core/Button";
import Container from "@material-ui/core/Container";
import TextField from "@material-ui/core/TextField";
import styled from "styled-components";
import {Container as BC} from "@types/react-bootstrap/";

// import "./Home.css";

type MyProps = {
  message: string;
};
type MyState = {
  count: number;
};

const StyledButton = styled(Button)`
  //width: 100%;
`;

const MyTextField = styled(TextField)`
  margin: 0 0 1rem 0;
`;

function Home(props: MyProps) {
  return (
    <Container>
      <h1 className="m-0">Duocard</h1>
      <MyTextField
        id="outlined-multiline-static"
        label="New Card"
        multiline
        rows={6}
        placeholder="Write your new Word"
        variant="outlined"
        className="w-100"
      />
      <BC className="w-50">
        <StyledButton variant="contained" color="primary">Save</StyledButton>
      </BC>
    </Container>
  );
}

export default Home;
